{{Quote|Bonnie is a bundle of uncontrollable and totally destructive energy. Her dream is to be fired from her cannon, all the way to the moon!}}
{{Portrait}}
Bonnie is an {{Rarity|Epic}} Brawler who has very high health and long range in her cannon form but can attain an alternate form that can deal very high damage while having low health. Bonnie has a slow movement speed in her cannon form but a very fast movement speed in her alternate form. In her cannon form, she fires a fast, long-ranged tooth. Her Super shoots Bonnie out of the cannon, transforming into her alternate form and dealing area damage upon landing. Bonnie's alternate form attacks by firing three shells which deal massive damage at a short range. Her alternate form's Super transforms her back into Bonnie's cannon form. Her first Gadget, Sugar Rush, momentarily increases Bonnie's movement and reload speed when inside her cannon form. Her second Gadget, Crash Test, allows Bonnie to dash a few tiles in the direction she is facing, knocking back and dealing damage to enemies in the way. Her first Star Power, Black Powder, increases Bonnie's cannon form's Super range. Her second Star Power, Wisdom Tooth, allows her cannon form's attack to split into 4 smaller projectiles upon hitting an enemy or obstacle.

==Attacks==
===Cannon: Loose Tooth===
{{Quote|Bonnie shoots a HUGE tooth from Clyde towards her enemies.}}In her cannon form, Bonnie fires a long-ranged tooth that deals moderate damage to enemies. Like [[Carl]], [[Bea]], or [[Charlie]], it has only one ammo slot, so kicking the ball in [[Brawl Ball]] does not consume ammo.

===Bonnie: Bomber Jacket===
{{Quote|Bonnie flings a cluster of small grenades from her sleeves.}}In her alternate form, Bonnie fires three shells in small spread from left to right. The shells each explode within a 0.67-tile radius upon impact, but don't charge Bonnie's Super.

==Supers==
===Cannon: Star Launcher===
{{Quote|Clyde launches Bonnie into the air. She can fly over obstacles and deals damage to nearby enemies on landing.}} Bonnie blasts into the air over obstacles. Upon landing, Bonnie changes into her alternate form, which modifies her attack and Super. It also deals damage to nearby enemies in a 2.33-tile radius. Bonnie always lands with all three ammo slots full, and maintains her previous health from her cannon form, but is capped off by her Bonnie form's maximum health.

===Bonnie: Clyde===
{{Quote|Bonnie calls Clyde and jumps into it, taking control of the cannon.}}Taking 16 seconds to auto-charge her Super, Bonnie transforms back into her cannon form after a 0.5-second delay, keeping the same amount of missing health. Similar to [[Meg]], if she is stunned, knocked back, or pulled during the transformation, her Super will be cancelled.

==Gadget==
===Sugar Rush===
{{Quote|Clyde's movement and reload speed are increased by 30% for 5 seconds.}}{{Gadget|1}}Upon activation, Bonnie appears red and her movement and reload speed are increased by 30% for 5 seconds. This Gadget can only be activated while Bonnie is in her cannon form.

===Crash Test===
{{Quote|Bonnie dashes forward, knocking back enemies and dealing 2320 damage on hit.}}{{Gadget|2}}Bonnie dashes 2 tiles in the direction she is facing when she uses this Gadget, knocking back and dealing 2320 damage to enemies in her path. Dashing into walls or water will cut the dash short, and this Gadget can only be activated while Bonnie is in her alternate form.

==Star Power==
===Black Powder===
{{Quote|The range of Bonnie's Star Launcher is increased by 36%.}}{{StarPower|1}}Bonnie's cannon form's Super range is increased from 7.33 tiles to 10 tiles.

===Wisdom Tooth===
{{Quote|Loose Tooth shatters on hit, dealing 25% extra damage to nearby enemies.}}{{StarPower|2}}This Star Power allows Bonnie's cannon form's attack to split in 4 smaller projectiles in a cross pattern that deal 25% of her attack damage to enemies, similar to [[Surge]]'s attack. The projectiles travel 2 tiles before they disappear.

